export function Images(){
    const images = require.context("../../public/images", true);
    const imageFilenames = images.keys();

    const imagesData = imageFilenames.map(filename => {
    const src = images(filename);
    const alt = filename.replace('./', '').replace(/\.[^/.]+$/, ''); return {
        src,
        alt,
        };
    });
    
    return(
        <div className="bg-gray-800 p-4 rounded-lg flex justify-center" style={{ position: "absolute", top: "30%", height: "40%", width: "70%" }}>
        <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 xl:grid-cols-5 gap-4">
          {imagesData.map((image) => (
            <div key={image.src}>
              <img src={image.src} alt={image.alt} style={{ height: "100%", width: "100%", objectFit: "cover", objectPosition: "top left" }} />
            </div>
          ))}
        </div>
      </div>
    )
}
